import React, {useEffect, useState} from 'react';
import axios from "axios";
import "./Sidebar.css"
import {Link} from "react-router-dom";

import Login from "../loginPage/Login";


const Main = () => {
    const [page, setPage] = useState()

    //메인 페이지 들어왔을 떄 바로 GET요청 한 후
    useEffect(() => {
        axios.get("http://localhost:8080/api/main")
            .then((res) => {
                console.log(res.data);
            })
    }, []);
    return (
        <div className="main">
            <ProfileModal>
                <div className="sidebar">
                    <nav>
                        <div className="userImg">
                            <button className="profileButton">
                                <img src={require('../defaultImg/DefaultUserImg.png')} alt="대체 텍스트"/>
                            </button>
                        </div>

                        <div className="categoryImg">
                            <ul>
                                <li>
                                    <Link to="/" element={<Login/>}>
                                        <img src={require("../defaultImg/DefaultCategoryImg.png")}/>
                                    </Link>
                                </li>
                                <li>
                                    <Link to="/" element={<Login/>}>
                                        <img src={require("../defaultImg/DefaultCategoryImg.png")}/>
                                    </Link>
                                </li>
                            </ul>
                        </div>
                    </nav>
                </div>
            </ProfileModal>
        </div>
    );
}

function ProfileModal() {
    return (
        <div className="mainProfileModal">

        </div>
    );
}

export default Main;
